import React from "react";

const Navbar = () => {
  const uid = true;
  return (
    <>
      <div>
        <header>
          <div className="logo">
            <img src="../img/logo-red-cut-rsz-1.png" alt="logo groupomania" />
          </div>
          {uid ? (
            <div className="nav">
              <ul>
                <li>
                  <a href="">Bienvenue Utilisateur</a>
                </li>
                <li>
                  <a href="">Accueil</a>{" "}
                </li>
                <li>
                  <a href="">Votre profil</a>{" "}
                </li>
              </ul>
            </div>
          ) : (
            <></>
          )}
        </header>
      </div>
    </>
  );
};

export default Navbar;
